},

{
    _id: crypto.randomUUID(),
    target: 'categories',
    name: 'Categories',
    icon: 'bi-window-stack',
    active: false

},

{
    _id: crypto.randomUUID(),
    target: 'library',
    name: 'My Library',
    icon: 'bi-heart',
    active: false

},

